import React from 'react';
import './App.css';

const Resume = () => {
  return (
    <div className="resume-container">
      {/* Navigation Bar */}
      <nav>
        <ul className="nav_place">
          <li>
            <a 
              className="nav_buttons" 
              href="/"
            >
              ‚Üê Back to Portfolio
            </a>
          </li>
        </ul>
      </nav>

      {/* Resume Content */}
      <div className="resume-content">
        <h1 className="Header">Resume</h1>

        {/* Resume PDF Viewer */}
        <div className="resume-pdf-container">
          <iframe
            src="/Images/Resume_Sodanapalli_Saaketh.pdf"
            title="Saaketh Sodanapalli Resume"
            width="100%"
            height="800px"
            style={{
              border: 'none',
              borderRadius: '12px',
              boxShadow: '0 8px 32px rgba(0, 0, 0, 0.3)',
              backgroundColor: '#ffffff'
            }}
          />
        </div>

        {/* Download Button */}
        <div className="resume-download">
          <a 
            href="/Images/Resume_Sodanapalli_Saaketh.pdf" 
            download="Saaketh_Sodanapalli_Resume.pdf"
            className="download-button"
          >
            üì• Download PDF
          </a>
        </div>
      </div>
    </div>
  );
};

export default Resume;
